open Jest

let () =
  describe "minus_tests" (fun () ->
  let open Expect in

  let minus_test =
    let count = ref 0 in
    fun (a, b, exp) ->
      count := !count + 1;
      let v = Big.minus (Big.fromString a) (Big.fromString b) |. Big.toString in
      test ("div_test" ^ string_of_int !count) (fun () -> expect v |> toBe exp)
  in

  let bool_test =
    let count = ref 0 in
    fun exp v ->
      count := !count + 1;
      test ("div_test_minus_zero" ^ string_of_int !count)
        (fun () -> expect v |> toBe exp) in

  let is_minus_zero x = Big.toString x = "0" && Big.s x = -1 in

  minus_test ("1", "0", "1");
  minus_test ("1", "-0", "1");
  minus_test ("-1", "0", "-1");
  minus_test ("-1", "-0", "-1");
  minus_test ("0", "1", "-1");
  minus_test ("0", "-1", "1");
  minus_test ("-0", "1", "-1");
  minus_test ("-0", "-1", "1");

  bool_test false (Big.minus (Big.fromInt 0) (Big.fromInt 0) |> is_minus_zero);
  bool_test false (Big.minus (Big.fromInt 0) (Big.fromString "-0") |> is_minus_zero);
  bool_test true (Big.minus (Big.fromString "-0") (Big.fromInt 0) |> is_minus_zero);
  bool_test false (Big.minus (Big.fromInt 1) (Big.fromInt 1) |> is_minus_zero);
  bool_test false (Big.minus (Big.fromInt (-1)) (Big.fromInt (-1)) |> is_minus_zero);

